def wrap(env: PokerGameEnv):
    env = wrappers.TerminateIllegalWrapper(env, illegal_reward=-1)
    env = wrappers.AssertOutOfBoundsWrapper(env)
    env = wrappers.OrderEnforcingWrapper(env)
    return env


def get_range_policy_(agent: Algorithm, prior, action_history, action_mask) -> list[list]:
    policy = [[0 for i in range(13)] for j in range(13)]
    for i in range(13):
        for j in range(13):
            # 'observation': spaces.Box(
            #     low=0.0, high=1.0, shape=(4, 4, 13), dtype=np.float32
            # ),
            # # 4(preflop, flop, turn, river) * num_players * max_num_actions_street, 5(fold, check, call, raise, all_in)
            # 'action_history': spaces.Box( 
            #     low=0.0, high=5.0, shape=(4, num_players * self.max_num_actions_street, 5), dtype=np.float32
            # ),
            # Fold Check Call All_in Raise_25% Raise_50% Raise_75% Raise_125%
            # action_mask = np.zeros(8, np.int8)
            # action_mask[0] = 1
            # action_mask[2] = 1
            # action_mask[3] = 1
            # action_mask[5] = 1
            # action_mask[6] = 1
            # action_mask[7] = 1

            observation_mat = np.zeros((4, 4, 13), np.float32)
            if i <= j: # pair or offsuit
                card0 = Card(rank=i, suit=0)
                card1 = Card(rank=j, suit=1)
            else:
                card0 = Card(rank=i, suit=0)
                card1 = Card(rank=j, suit=0)
            for hole_card in [card0, card1]:
                observation_mat[0][hole_card.suit][hole_card.rank] = 1.0

            # for run in range(100):
            action = agent.compute_single_action(
                {"observation": observation_mat, "action_history": action_history, "action_mask": action_mask},
                policy_id='learned',
                full_fetch=True,
            )
            prob = action[2]['action_dist_inputs']
            prob_sum = sum([math.exp(prob[action]) for action in range(8)])
            policy[i][j] = [math.exp(prob[action]) / prob_sum * prior[i][j] for action in range(8)]
                # exit(0)
                # policy[i][j] += action / 100.0
    return policy


def get_range_policy(agent: Algorithm, observation) -> list[list]:
    policy = [[0 for i in range(13)] for j in range(13)]
    # 'observation': spaces.Box(
    #     low=0.0, high=1.0, shape=(4, 4, 13), dtype=np.float32
    # ),
    # # 4(preflop, flop, turn, river) * num_players * max_num_actions_street, 5(fold, check, call, raise, all_in)
    # 'action_history': spaces.Box( 
    #     low=0.0, high=5.0, shape=(4, num_players * self.max_num_actions_street, 5), dtype=np.float32
    # ),
    # Fold Check Call All_in Raise_25% Raise_50% Raise_75% Raise_125%

    action = agent.compute_single_action(
        observation,
        policy_id='learned',
        full_fetch=True,
    )
    prob = action[2]['action_dist_inputs']
    prob_sum = sum([math.exp(prob[i]) for i in range(8)])
    return [math.exp(prob[i]) / prob_sum for i in range(8)]


def print_range_policy(obs, policy):
    print("BOARD:")
    for street in range(1, 4):
        for suit in range(4):
            for rank in range(13):
                if obs['observation'][street][suit][rank] > 0:
                    print(Card(suit=suit, rank=rank), end = ' ')
    print()
    for i in range(12, -1, -1):
        for j in range(12, -1, -1):
            print(', '.join(map(lambda x: '%.2f'%x, policy[i][j])), end = '   ')
        print()

def step(env: NoLimitTexasHoldemEnv, agent, prior, action):
    game_obs: Observation = env.game.observe(env.game.current_player)
    log.info(game_obs)
    obs = env.observe('agent_' + str(game_obs.current_player))
    policy = get_range_policy_(agent, prior[game_obs.current_player], obs['action_history'], obs['action_mask'])
    print_range_policy(obs, policy)
    for i in range(13):
        for j in range(13):
            prior[game_obs.current_player][i][j] *= policy[i][j][action]
    env.step(action)

